import React from 'react';

function MyButton() {
    const goToHomePage = () => {
        window.location.href = '/'; // Redirect to the home page
    };

    return (
        <button onClick={goToHomePage} className="button-class">
            Go Home
        </button>
    );
}

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
                <p>This is a learning page</p>
                <a
                    className="App-header"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
                </a>
            </header>
            <MyButton /> {/* Include the button in the App component */}
        </div>
    );
}

export default App;
